import React from "react";
import { NavLink } from "react-router-dom";
import { useSelector } from "react-redux";

const linkStyles = {
    display: "inline-block",
    textAlign: "center",
    width: "100px",
    padding: "12px",
    margin: "6px 6px 6px",
    background: "white",
    textDecoration: "none",
    color: "black",
};

function NavBar() {

    user = useSelector((state) => state.user)

    return (
        <div className="navbar">
            <NavLink 
                to='/' 
                exact
                style={linkStyles}
                activeStyle={{
                    background: "#E2D8D2"
                }}
            >
                Home
            </NavLink>
            <h2>{user.username}</h2>
        </div>
    );
}

export default NavBar;
